const isOpenAIUp = async () => {
    try {
        const parameterName = '/openai/api/status';

        const input = { // GetParameterRequest
            Name: parameterName, // required
        };

        const command = new GetParameterCommand(input);
        const data = await ssmClient.send(command);
        const status = data.Parameter.Value;

        console.log(`OpenAI API status: ${status}`);

        if (status === "operational") {
            return true
        } else {
            return false
        }

    } catch (error) {
        console.error('Failed to retrieve status:', error);
        return false
    }
}

